        const res = await axios.get(`${BASE_URL}/trending/movie/week`, {params:{ api_key: API_KEY}});
        setTrendings(res.data.results);

    }

    return(
        <div>
        <div className ="mt-2 text-light card bg-info p-2">
            <h2>Trending Now</h2>
        </div>
        {
            trendings.map(movie => {
